import React from "react";
import { Link} from "react-router-dom";
import HomebtImg from  "../assets/homebotton.png"

const HomeButton = (props) => {
  return(
     <Link className="" to="/">
          <img src={HomebtImg} className="" alt="logo" />
      </Link>
  )
}

export default HomeButton;
